import React from 'react';
import { Container, Grid, Drawer, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { Home, Inbox, Mail } from '@mui/icons-material';

const App = () => {
  const pageStyles = {
    backgroundColor: '#111115',
    minHeight: '100vh',
  };

  const sidebarStyles = {
    backgroundColor: ' #151515', // Individual sidebar background color
    width: '8vw',
    padding: '16px',
    minHeight: '100vh',
    marginLeft: "-130px"
  };

  const listItemStyles = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '12px',
  };

  return (
    <div style={pageStyles}>
      <Container>
        <Grid container>
          <Grid sx={sidebarStyles}>
               <List>
                <ListItem button sx={listItemStyles}>
                  <ListItemIcon>
                    <Home />
                  </ListItemIcon>
                   </ListItem>
                <ListItem button sx={listItemStyles}>
                  <ListItemIcon>
                    <Inbox />
                  </ListItemIcon>
                 </ListItem>
                <ListItem button sx={listItemStyles}>
                  <ListItemIcon>
                    <Mail />
                  </ListItemIcon>
                </ListItem>
              </List>

          </Grid>

          <Grid item xs={6}>
            {/* Main content */}
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default App;
